import copy,time
class Solution(object):
    def findSubstring(self, s, words):
        wordlen,wordmap_orig,retval=len(words[0]),{},[]
        substringlen=wordlen*len(words)
        if wordlen==0 or len(s)<substringlen: return retval
        for w in words:
            wordmap_orig[w]=1 if w not in wordmap_orig else wordmap_orig[w]+1
        for i in xrange(len(s)-substringlen+1):
            wordmap=copy.deepcopy(wordmap_orig)
            for j in xrange(len(words)):
                tmp=s[i+j*wordlen:i+(j+1)*wordlen]
                if tmp not in wordmap:
                    break
                else:
                    if wordmap[tmp]==1: del wordmap[tmp]
                    else: wordmap[tmp]-=1
                    if len(wordmap)==0: retval.append(i)
        return retval

